import React ,{useState, useEffect} from "react";
const ProfilePage =()=>{
  const [users, setUsers] = useState([])
  const fetchUserData = () => {
    fetch("http://localhost:8000/registers")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setUsers(data)
      })
  }
useEffect(()=>{
  fetchUserData();
},[]);
    return(
        <>
<div className="App">
<h1 style={{ color: "red" }}>User Profile</h1>
<table cellPadding="0" cellSpacing="0">
      <tr>
    <th>User id</th>
    <th>Name</th>
    <th>User Name</th>
    <th>Email</th>
  </tr>
    { users.map((item )=>{
            return (
              <tr>
              <td> {item.id}</td>
              <td>{ item.name}</td>
              <td>{ item.usename}</td>
              <td>{ item.email}</td>
              </tr>
            );
          })
          }
 </table>
  </div>
</>
    );
 }
export default ProfilePage;
